  <div class="login">
    <div class="logo"></div>
    <div class="welcome">您好，欢迎来到益迈！</div>
    <div class="inputLint first">

      <div class="region">中国 &nbsp;+86</div>
      <input placeholder="输入手机号" class="input" type="number" v-model="number" />
    </div>
    <div class="inputLint second">

      <input placeholder="短信验证码" v-model="code"  type="number"  class="verif" />
    <div class="getBtn" :class="{'getting':getting}" @click="getVerif">{{getText}}
      <b v-if="getting" class="s">S</b>

    </div>
    </div>
    <div class="loginBtn" @click="go('index')">绑定</div>
    <span class="checkBox" @click="show=!show">
        <i :class="{show:show}" ></i>
 </span>
     <div class="need" @click="goNeed"> 用户须知</div>
  </div>
</template>
<script>
  import http from '../../http'
  export default {
   name:'login',
    data(){
     return {
       getText: '免费获取',
       number: '',
       realCode: 0,
       code: '',
       getting: false,
       show: true,
     }
    },
    methods:{
      goNeed(){
        var url = `../userNotes/main`;
        wx.navigateTo({ url });
        wx.setNavigationBarTitle({
          title: '用户须知'
        });
      },
      go(route){
        console.log(this.show);

        if(!this.number){
          wx.showToast({
            title: '手机号不正确',
            icon: 'none',
            duration: 2000
          });

          return
        }
        if(!this.code){
          wx.showToast({
            title: '请输入验证码',
            icon: 'none',
            duration: 2000
          });

          return
        }

       if(!this.show){
         wx.showToast({
           title: '请确认遵守用户须知',
           icon: 'none',
           duration: 2000
         });
         return
       }
        let data ={
        openId: '',
        phone: this.number,
        code: this.code
      };

       http.login(data,(res) => {
         if(res.code==0){
           wx.setStorageSync('TOKEN', res.data.key);
           wx.setStorageSync('isfirst', '1');
           var num = this.number;
           wx.setStorageSync("number", num );
           var url = `../${route}/main`;
           wx.navigateTo({ url });
           wx.setNavigationBarTitle({
             title: '行迹'
           });
         }
         else if(res.code==1){
           wx.showToast({
             title: res.msg,
             icon: 'none',
             duration: 2000
           });
         }
         else{
           wx.showToast({
             title: '绑定失败',
             icon: 'none',
             duration: 2000
           });
         }
        });
      },
     getVerif(){
        if(!this.getting){
          this.getText= 60;
          this.getting= true;
          http.getCode(this.number,(res) => {
          if(res.code==0){
            this.realCode= res.msgCode;
          }
          else if(res.code==2){
            wx.showToast({
              title: res.msg,
              icon: 'none',
              duration: 2000
            })
          }
          else{
            wx.showToast({
              title: '获取验证码失败',
              icon: 'none',
              duration: 2000
            });
          }
          })
        }
        else{
          return
        }
      var t=  setInterval(() => {
          this.getText--;
          if(this.getText<=0){
            this.getting= false;
            this.getText='免费获取';
              clearInterval(t)
          }
        },1000)

      },
      getInfo(){
        http.getInfo()
      },
      messageSave(){
        http.messageSave()
      },
      getCode(){
        http.getCode(() => {})
      },
      getCarList(){
        http.getCarList(() => {})
      },
      getMessageList(){
        http.getMessageList(() => {})
      },
      getMessageDetial(){
        http.getMessageDetial(5263,() => {})
      },
      addCar(){
        http.addCar(() => {})
      },
      login(){
        http.login(() => {})
      },
      opinionSave(){
        http.opinionSave(() => {})
      },
      getOpinionList(){
        http.getOpinionList(() => {})
      },
      getAgreement(){
        http.getAgreement(1)

      },
      getTrackDetialList(){
        http.getTrackDetialList(359339075216250,Date.parse(new Date())  ,()=> {})
      },
      getTrackDetial(){
        http.getTrackDetial(359339075216250,Date.parse(new Date()),() => {})
      }
    },
    onShow(){
      wx.setNavigationBarTitle({
        title: '绑定'
      });
    },
    mounted(){
      // this.getText= '免费获取'
      // this.getting= false;
      // this.realCode= 0;
    }
  }
</script>
